import React from 'react';
import {
    Show,
    SimpleShowLayout,
    TextField,
    NumberField,
    BooleanField,
    ReferenceField,
    ArrayField,
    SelectArrayInput, ReferenceArrayInput
} from 'react-admin';

const CategoryShow = (props) => {
    return (
        <Show {...props}>
            <SimpleShowLayout>
                <TextField source='id' />
                <TextField source='name' />
                <TextField source='creator.email' />
                <NumberField source='limit' />
                <BooleanField source='visibility'/>
                <ReferenceField
                    label='Photos in category'
                    source="photoList"
                    reference='photos'>
                    <ArrayField
                        source='title'
                    />
                </ReferenceField>
            </SimpleShowLayout>
        </Show>
    )
};

export default CategoryShow;
